public class Calculate {

	public Calculate() {
		// TODO Auto-generated constructor stub
	}
	
	public int sum(int a, int b) {
		return a +b;
	}
	
	public int substract(int a,int b) {
		return a- b;
	}
	
	public int multiply(int a,int b) {
		return a*b;
	}
	
	public int divide(int a, int b) {
		return a/b;
	}
}
